/* eslint-disable no-alert */
import React from "react";
import { useTheme } from "@mui/material/styles";
import SubCard from "ui-component/cards/SubCard";
import {
  Card,
  CardContent,
  Grid,
  Typography,
  Radio,
  RadioGroup,
  FormControlLabel,
  Avatar,
} from "@mui/material";
import { gridSpacing } from "store/constant";
import LocalShippingIcon from '@mui/icons-material/LocalShipping';
import LocalCafeIcon from '@mui/icons-material/LocalCafe';



const TipoServicio = ({ hidden, sethidden }) => {
  const theme = useTheme();
  const cardStyle = {
    background:
      theme.palette.mode === "dark"
        ? theme.palette.dark.main
        : theme.palette.grey[50],
    border: "1px solid",
    borderColor: theme.palette.primary.main

  };

  const [value, setvalue] = React.useState({
    tipo: "",
  });

  const handleChange = (e) => {
    if (e.target.value === "p") {
      sethidden({
        ...hidden,
        ltl: true,
        ftl: false,
        expo: true,
        summary: true,
      });
      setvalue({
        tipo: e.target.value,
      });
    } else {
      sethidden({
        ...hidden,
        ltl: false,
        ftl: true,
        expo: true,
        summary: true,
      });
      setvalue({
        tipo: e.target.value,
      });
    }
  };

  return (
    <div>
      <SubCard title="Seleccione Requerimiento a Solicitar">
        <Card sx={cardStyle}>
          <CardContent
            sx={{ minHeight: 240, color: theme.palette.common.black }}
          >
            <RadioGroup
              aria-label="servicios"
              name="servicios"
              value={value.tipo}
              onChange={handleChange}
            >
              <Grid container spacing={gridSpacing}>
                <Grid item>
                  <Avatar>
                  <LocalShippingIcon/>
                  </Avatar>
                </Grid>
                <Grid item>
                  <FormControlLabel
                    value="p"
                    control={<Radio />}
                    label="International Shipping"
                  /> <p />
                  <Typography
                    style={{ color: "#FF9900", alignItems: "center" }}
                    variant="caption"
                    gutterBottom
                  >
                    <strong>xxxxxxx</strong>
                  </Typography>
                </Grid><br></br>
                <Grid item>
                  <Avatar>
                  <LocalCafeIcon></LocalCafeIcon>
                  </Avatar>
                </Grid>
                <Grid item>
                  <FormControlLabel
                    value="f"
                    control={<Radio />}
                    label="FDA Services"
                  />
                  <p />
                  <Typography
                    style={{ color: "#FF9900", alignItems: "center" }}
                    variant="caption"
                    gutterBottom
                  >
                    <strong>xxxxxxxx</strong>
                  </Typography>
                </Grid>
                <Grid item>
                  <FormControlLabel
                    value="f"
                    control={<Radio />}
                    label="FDA Services"
                  />
                  <p />
                  <Typography
                    style={{ color: "#FF9900", alignItems: "center" }}
                    variant="caption"
                    gutterBottom
                  >
                    <strong>xxxxxxxx</strong>
                  </Typography>
                </Grid>
                <Grid item>
                  <FormControlLabel
                    value="f"
                    control={<Radio />}
                    label="FIOR and BOND USA"
                  />
                  <p />
                  <Typography
                    style={{ color: "#FF9900", alignItems: "center" }}
                    variant="caption"
                    gutterBottom
                  >
                    <strong>xxxxxxxx</strong>
                  </Typography>
                </Grid>
                <Grid item>
                  <FormControlLabel
                    value="f"
                    control={<Radio />}
                    label="Customs Consulting"
                  />
                  <p />
                  <Typography
                    style={{ color: "#FF9900", alignItems: "center" }}
                    variant="caption"
                    gutterBottom
                  >
                    <strong>xxxxxxxx</strong>
                  </Typography>
                </Grid>
              </Grid>
            </RadioGroup>
          </CardContent>
        </Card>
      </SubCard>
    </div>
  );
};

export default TipoServicio;
